import React from "react";
import './App.css';

const Main=()=>{
    return(
        <>
          <div className="koo">
            <div className="book">
              <h1> Book works </h1>
             </div>
             <div className="input">
               <form>
                <input placeholder="Search Books"/>
                   <button type="submit">Search</button>
                </form>
             </div>
          </div>
        </>
    )
}
export default Main;
